var response = JSON.parse(responseBody);
var rccDigits = response.body.rccDigits.split(",");
var rcc_password = postman.getEnvironmentVariable("rcc_password");
for (var i = 0; i < rccDigits.length; ++i) {
    rccDigits[i] = rcc_password.charAt(rccDigits[i] - 1);
}
postman.setEnvironmentVariable("rcc_answer", rccDigits.join(""));

var token = postman.getResponseHeader("x-authtoken");
pm.environment.set("tp-token", token);

// set saml token
pm.environment.set("saml", responseBody);
console.info(responseBody);

// set userId
var saml_obj = xml2Json(responseBody);
var userId = saml_obj["saml:Assertion"]["saml:Subject"]["saml:NameID"];
console.info("user-id: "+userId);
pm.environment.set("user-id", userId)

